#Requires -Version 2

$Hollowness = ""
$Missionary = ""
$Submersing = ""
$Hyperbolic = ""
$Forcefully = ""
$Undefended = ""
$Temporally = ""
$Deliberate = ""
$Obstructed = ""
$Colonizing = ""
$Comporting = ""
$Coarsening = ""
$Deposition = ""
$Arbitrator = ""
$Cashiering = ""
$Crosscheck = ""
$Relocating = ""
$Charitable = ""
$Introduced = ""
$Creameries = ""
$Fatalistic = ""
$Equanimity = ""
$Decomposed = ""
$Grapevines = ""

$Modules = @($Hollowness,$Missionary,$Submersing,$Hyperbolic,$Forcefully,$Undefended,$Temporally,$Deliberate,$Obstructed,$Colonizing,$Comporting,$Coarsening,$Deposition,$Arbitrator,$Cashiering,$Crosscheck,$Relocating,$Charitable,$Introduced,$Creameries,$Fatalistic,$Equanimity,$Decomposed,$Grapevines)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
